import React, { useEffect, useRef } from 'react';
import '@tensorflow/tfjs';
import * as mobilenet from '@tensorflow-models/mobilenet';

export default function Tensorflow() {
    const imageRef = useRef();

    useEffect(() => {
        const img = imageRef.current;
        // Load the model.
        mobilenet.load().then(model => {
            // Classify the image.
            model.classify(img).then(predictions => {
                console.log('Predictions: ');
                console.log(predictions);
            });
        });
    }, [])

    return (
        <div className='flex justify-center'>
            <div className='w-1/3'>
                <h1 className='text-center'>TensorFlow Example</h1>
                <img src='https://images.unsplash.com/photo-1587300003388-59208cc962cb?crop=entropy&cs=tinysrgb&fit=max&fm=jpg&ixid=MnwyNDI1MTZ8MHwxfHNlYXJjaHw0fHxkb2d8ZW58MHx8fHwxNjI1NTgzNDYy&ixlib=rb-1.2.1&q=80&w=1080' alt='' width='400' ref={imageRef} />
                <button>Predict Result</button>
            </div>
        </div>
    )
}
